import{_ as i,o as a,c as o,z as t,a as e}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 33.2-2812 Dissolution of the Authority.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-2812.md","filePath":"vacode/33.2-2812.md"}'),s={name:"vacode/33.2-2812.md"},r=t("h1",{id:"§-33-2-2812-dissolution-of-the-authority",tabindex:"-1"},[e("§ 33.2-2812 Dissolution of the Authority. "),t("a",{class:"header-anchor",href:"#§-33-2-2812-dissolution-of-the-authority","aria-label":'Permalink to "§ 33.2-2812 Dissolution of the Authority."'},"​")],-1),n=t("p",null,"Whenever the Authority Board by resolution determines that the purposes for which the Authority was formed have been substantially complied with and all bonds issued and all obligations incurred by the Authority have been fully paid or adequate provisions have been made for the payment, the Authority Board shall execute and file for record with the participating localities, agencies, institutions, and facilities a resolution declaring such facts and providing for the disposition of the Authority assets, consistent with applicable state and federal law. If the participating localities, agencies, institutions, and facilities are of the opinion that the facts stated in the Authority's resolution are true and the Authority should be dissolved, they shall so resolve and the Authority shall stand dissolved as of the date on which the last participating locality, agency, institution, or facility adopts such resolution.",-1),l=t("p",null,[e("2009, c. "),t("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0645",target:"_blank",rel:"noreferrer"},"645"),e(", § 15.2-7035; 2014, c. "),t("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805",target:"_blank",rel:"noreferrer"},"805"),e(".")],-1),h=[r,n,l];function d(c,u,f,p,_,y){return a(),o("div",null,h)}const b=i(s,[["render",d]]);export{v as __pageData,b as default};
